webpackJsonp([0xc4be0dc5f200],{7829:function(e,t){e.exports={data:{post:{html:'<p>We were able to announce our <a href="http://www.papascott.de/archives/2007/03/27/bricks-and-mortar/">big change</a> today because MamaMaus broke the news to her staff today. One of her team members told her on the phone this evening, "I guess you\'ll only be around for a couple more days... plus twenty years".</p>\n<p>That\'s true. The franchise contract for McDonald\'s runs for twenty years. By that time I\'ll be 65 and ready for something new.</p>\n<p>Then again, many franchise contracts are extended into <a href="http://www.bizjournals.com/columbus/stories/2007/03/19/focus2.html?b=1174276800%5E1432966">"second generation"</a>. In twenty years Christopher will be 27...</p>',fields:{title:"Plus Twenty Years",date:"27 Mar 2007",url:"https://papascott.de/2007-03-27-plus-twenty-years/"}}},pathContext:{slug:"/2007-03-27-plus-twenty-years/",prev:{fields:{title:"Bricks and Mortar",date:"27 Mar 2007",slug:"/2007-03-27-bricks-and-mortar/"}},next:{fields:{title:"Hamburg Sunny Day",date:"28 Mar 2007",slug:"/2007-03-28-hamburg-sunny-day/"}}}}}});
